import base64
import subprocess

def decode_base64_audio(base64_string, output_filename):
    """
    Decodifica uma sequência de áudio codificada em base64 e a salva em um arquivo. 

    Args:
        base64_string: Dados de áudio codificados em base64.
        output_filename: O nome do arquivo para salvar os dados de áudio decodificados (e.g., "audio.webm").
    """
    try:
        decoded_bytes = base64.b64decode(base64_string)
        with open(output_filename, 'wb') as file:
            file.write(decoded_bytes)
        print(f"Decodificado e salvo com sucesso em {output_filename}")
    except Exception as e:
         print(f"Erro ao decodificar dados base64: {e}")

def convert_to_audio(input_filename, output_filename):
    """
    Converte um arquivo de áudio em formato de áudio usando FFmpeg.

    Args:
        input_filename: O caminho para o arquivo de áudio de entrada.
        output_filename: O caminho para salvar o arquivo de áudio convertido.
    """
    try:
        subprocess.run(['ffmpeg', '-i', input_filename, output_filename], check=True, capture_output=True)
        print(f"Convertido com sucesso {input_filename} para {output_filename}")
    except subprocess.CalledProcessError as e:
        print(f"Erro ao converter para áudio: {e}")
    except FileNotFoundError:
        print("FFmpeg não está instalado ou não está no PATH do sistema.")

