# Salve os dados decodificados como um arquivo webm 
decoded_filename = "audio.webm"
decode_base64_audio(base64_string, decoded_filename)

# Converte o arquivo decodificado para o formato (OGG, MP3, WAV)
wav_filename = "audio.ogg"
convert_to_audio(decoded_filename, wav_filename)